import React from 'react';
import './Modal.css';


class Modal extends React.Component {
    state = {
        visibility: this.props.visibility
    }


    render() {
        return (
            <div className={`modal ${this.state.visibility}`}>
                <img src={this.props.ModalPic} alt=""/>
                {this.props.ModalPic}
            </div>
        )
    }
}

export default Modal;
